--
-- Table structure for table `house_detail`
--

DROP TABLE IF EXISTS `house_detail`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `house_detail` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `house_id` int NOT NULL COMMENT '房屋id',
  `house_owner` int DEFAULT NULL COMMENT '房源拥有者',
  `contact_id` int DEFAULT NULL COMMENT '房源联系人id',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房屋详细地址',
  `room_num` int DEFAULT NULL COMMENT '房间号',
  `display_content` json DEFAULT NULL COMMENT '房屋展示内容json',
  `floor` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房屋所在楼层',
  `max_floor` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房屋最大楼层',
  `has_elevator` tinyint DEFAULT NULL COMMENT '是否有电梯（0没有、1有)',
  `build_year` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '建成年份',
  `direction` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房屋朝向',
  `lighting` tinyint DEFAULT NULL COMMENT '房源采光情况',
  `near_traffic_json` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '附近交通信息',
  `certificate_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房产证号',
  `location_info` json DEFAULT NULL COMMENT '房源地理位置信息',
  `json_extend` json DEFAULT NULL COMMENT '扩展字段',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `house_id_index` (`house_id`) USING BTREE COMMENT '房屋id索引',
  KEY `house_owner_index` (`house_owner`) USING BTREE COMMENT '房屋拥有者索引',
  KEY `address_index` (`address`) USING BTREE COMMENT '房源地址索引',
  KEY `create_time_index` (`create_time`) USING BTREE COMMENT '创建时间索引',
  KEY `update_time_index` (`update_time`) USING BTREE COMMENT '更新时间索引'
) ENGINE=InnoDB AUTO_INCREMENT=321 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='房屋详情表';
/*!40101 SET character_set_client = @saved_cs_client */;

