--
-- Table structure for table `house_info`
--

DROP TABLE IF EXISTS `house_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `house_info` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `rent_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '出租类型, 整租 合租 日租',
  `house_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '房屋类型，小区房、公寓、自家房',
  `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房屋标题',
  `index_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房屋首页图片',
  `house_desc` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '房屋描述',
  `city` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '房屋所在城市',
  `district` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '区县',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '房屋地址',
  `rent_state` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'not_rent' COMMENT '出租状态',
  `rent_money` int DEFAULT NULL COMMENT '租赁金额（单位/分、元/100）',
  `bargain_money` int DEFAULT '0' COMMENT '定金',
  `rent_time_unit` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '租赁时间单位，默认month（月结）',
  `water_rent` int DEFAULT '0' COMMENT '水费（单位/分，元/100）',
  `electricity_rent` int DEFAULT '0' COMMENT '电费（单位/分，元/100）',
  `strata_fee` int DEFAULT '0' COMMENT '管理费（单位/分，元/100）',
  `deposit_ratio` int DEFAULT '1' COMMENT '租赁费用的押金倍数（押几付几）',
  `pay_ratio` int DEFAULT '1' COMMENT '租赁费用的支付倍数（押几付几）',
  `bedroom_num` int DEFAULT NULL COMMENT '卧室数量',
  `living_room_num` int DEFAULT '0' COMMENT '客厅数量',
  `kitchen_num` int DEFAULT '0' COMMENT '厨房数量',
  `toilet_num` int DEFAULT '0' COMMENT '卫生间数量',
  `area` int DEFAULT NULL COMMENT '房屋总体面积',
  `publish_time` datetime NOT NULL COMMENT '发布时间',
  `state` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'auditing' COMMENT '房屋状态',
  `json_extend` json DEFAULT NULL COMMENT '扩展字段',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `house_owner` int DEFAULT NULL COMMENT '房屋拥有者',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `rent_type_index` (`rent_type`) USING BTREE COMMENT '租赁类型索引',
  KEY `house_type_index` (`house_type`) USING BTREE COMMENT '房屋类型索引',
  KEY `title_index` (`title`) USING BTREE COMMENT '房屋标题索引',
  KEY `city_index` (`city`) USING BTREE COMMENT '房源所在城市索引',
  KEY `address_index` (`address`) USING BTREE COMMENT '房源地址索引',
  KEY `rent_state_index` (`rent_state`) USING BTREE COMMENT '租赁状态索引',
  KEY `house_struct_index` (`bedroom_num`,`living_room_num`,`kitchen_num`,`toilet_num`) USING BTREE COMMENT '房屋内部构造联合索引',
  KEY `state_index` (`state`) USING BTREE COMMENT '房源状态索引',
  KEY `create_time_index` (`create_time`) USING BTREE COMMENT '创建时间索引',
  KEY `update_time_index` (`update_time`) USING BTREE COMMENT '更新时间索引',
  KEY `house_owner_index` (`house_owner`) USING BTREE COMMENT '房屋拥有者索引'
) ENGINE=InnoDB AUTO_INCREMENT=321 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='房屋信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

