INSERT INTO `template` VALUES (1,'<div id=\"content\" style=\"padding: 10px;\">\r\n                                <h2 style=\"text-align: center;\">　房屋租赁合同</h2>\r\n                                <p>　　出租方：<strong>{{ landlord_name }}</strong> (以下简称甲方)</p>\r\n                                <p>　　身份证：<strong>{{ landlord_id_card }}</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;电话：<strong>{{ landlord_mobile }}</strong></p>\r\n                                <p>　　承租方：<strong>{{ tenant_name }}</strong> (以下简称乙方)</p>\r\n                                <p>　　身份证：<strong>{{ tenant_id_card }}</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;电话：<strong>{{ tenant_mobile }} </strong></p>\r\n                                <p>　　根据甲、乙双方在自愿、平等、互利的基础上，经协商一致，为明确双方之间的权利义务关系，就甲方将其合法拥有的房屋出租给乙方使用，乙方承租甲方房屋事宜，订立本合同。</p>\r\n                                <p>　　一、房屋地址：<strong>{{ house_address }}</strong></p>\r\n                                <p>　　二、租赁期限及约定</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(1) 该房屋租赁期共 <strong>{{ rental_days }}</strong> 天。\r\n                                    自 <strong>{{ start_date }}</strong> 到\r\n                                    <strong> {{ end_date }} </strong>\r\n                                </p>\r\n                                <p>　　三、房屋租赁信息：</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(1) 房屋类型：\r\n                                    <strong>{{ bedroom_num }}</strong>卧室&nbsp;\r\n                                    <strong>{{ living_room_num }}</strong>客厅&nbsp;\r\n                                    <strong>{{ toilet_num }}</strong>卫生间&nbsp;\r\n                                    <strong>{{ kitchen_num }}</strong>厨房&nbsp;</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(2) 租赁费用明细： 押 <strong>{{ deposit_ratio }}</strong> 付 <strong>{{ pay_ratio }}</strong></p>\r\n                                <p style=\"text-indent: 4rem;\">　　房屋租金: <strong>￥{{ rent_money }} </strong>元/月</p>\r\n                                <p style=\"text-indent: 4rem;\">　　房屋押金: <strong>￥{{ deposit_fee }} </strong>元</p>\r\n                                <p style=\"text-indent: 4rem;\">　　水费: <strong>￥{{ water_rent }}</strong>元/吨&nbsp;&nbsp;&nbsp;\r\n                                    电费: <strong>￥{{ electricity_rent }}</strong>元/度&nbsp;&nbsp;&nbsp;\r\n                                    管理费: <strong>￥{{ strata_fee }}</strong>元/月&nbsp;</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(3) 房屋终止，甲方验收无误后，将押金退还乙方，不计利息。</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(4) 乙方向甲方承诺，租赁该房屋仅作为普通住房使用。</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(5) 租赁期满，甲方有权收回出租房屋，乙方应如期交还。乙方如要求续租，则必须在租赁期满前一个月内通知甲方，经甲方同意后，重新签订租赁合同。</p>\r\n                                <p>　　三、房屋修缮与使用</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(1) 在租赁期内，甲方应保证出租房屋的使用安全。乙方应合理使用其所承租的房屋及其附属设施。如乙方因使用不当造成房屋及设施损坏的，乙方应负责修复或给予经济赔偿。</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(2) 该房屋及所属设施的维修责任除双方在本合同及补充条款中约定外，均由甲方负责(但乙方使用不当除外)。甲方进行维修须提前七天通知乙方，乙方应积极协助配合。</p>\r\n                                <p style=\"text-indent: 2rem;\">\r\n                                    　　(3) 乙方因使用需要，在不影响房屋结构的前提下，可以对房屋进行装修装饰，但其设计规模、范围、工艺、用料等方案应事先征得甲方的同意后方可施工。租赁期满后，依附于房屋的装修归甲方所有。对乙方的装修装饰部分甲方不负有修缮的义务。</p>\r\n                                <p>　　四、房屋的转让与转租</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(1) 租赁期间，未经甲方书面同意，乙方不得擅自转租、转借承租房屋。</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(2) 甲方同意乙方转租房屋的，应当单独订立补充协议，乙方应当依据与甲方的书面协议转租房屋。</p>\r\n                                <p>　　五、乙方违约的处理规定</p>\r\n                                <p>\r\n                                    　　在租赁期内，乙方有下列行为之一的，甲方有权终止合同，收回该房屋，乙方应向甲方支付合同总租金20%的违约金，若支付的违约金不足弥补甲方损失的，乙方还应负责赔偿直至达到弥补全部损失为止。</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(1) 未经甲方书面同意，擅自将房屋转租、转借给他人使用的;</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(2) 未经甲方同意，擅自拆改变动房屋结构或损坏房屋，且经甲方通知，在规定期限内仍未纠正并修复的;</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(3) 擅自改变本合同规定的租赁用途或利用该房屋进行违法活动的;</p>\r\n                                <p style=\"text-indent: 2rem;\">　　(4) 拖欠房租累计一个月以上的。</p>\r\n                                <p>　　六、本协议一式两份，甲.乙各执一份，乙方支付后即行生效。</p>\r\n                                <!--            <p>　　七、其他说明：水电数字由甲乙双方与其他承租方平均分配</p>-->\r\n                                <!--            <p>　　甲方签字：　　　　　　乙方签字：</p>-->\r\n                                <!--            <p>　　联系方式：　　　　　　联系方式：</p>-->\r\n\r\n                            </div>','{\"end_date\": {\"field_name\": \"end_date\", \"db_model_manager\": \"OrderManager\"}, \"pay_ratio\": {\"field_name\": \"pay_ratio\", \"db_model_manager\": \"HouseInfoManager\"}, \"rent_money\": {\"field_name\": \"rent_money\", \"db_model_manager\": \"HouseInfoManager\"}, \"start_date\": {\"field_name\": \"start_date\", \"db_model_manager\": \"OrderManager\"}, \"strata_fee\": {\"field_name\": \"strata_fee\", \"db_model_manager\": \"HouseInfoManager\"}, \"toilet_num\": {\"field_name\": \"toilet_num\", \"db_model_manager\": \"HouseInfoManager\"}, \"water_rent\": {\"field_name\": \"water_rent\", \"db_model_manager\": \"HouseInfoManager\"}, \"bedroom_num\": {\"field_name\": \"bedroom_num\", \"db_model_manager\": \"HouseInfoManager\"}, \"deposit_fee\": {\"field_name\": \"deposit_fee\", \"db_model_manager\": \"OrderManager\"}, \"kitchen_num\": {\"field_name\": \"kitchen_num\", \"db_model_manager\": \"HouseInfoManager\"}, \"rental_days\": {\"field_name\": \"rental_days\", \"db_model_manager\": \"OrderManager\"}, \"tenant_name\": {\"role\": \"tenant\", \"field_name\": \"real_name\", \"db_model_manager\": \"UserProfileManager\"}, \"deposit_ratio\": {\"field_name\": \"deposit_ratio\", \"db_model_manager\": \"HouseInfoManager\"}, \"house_address\": {\"field_name\": \"address\", \"db_model_manager\": \"HouseInfoManager\"}, \"landlord_name\": {\"role\": \"landlord\", \"field_name\": \"real_name\", \"db_model_manager\": \"UserProfileManager\"}, \"tenant_mobile\": {\"role\": \"tenant\", \"field_name\": \"mobile\", \"db_model_manager\": \"UserProfileManager\"}, \"tenant_id_card\": {\"role\": \"tenant\", \"field_name\": \"id_card\", \"db_model_manager\": \"UserProfileManager\"}, \"landlord_mobile\": {\"role\": \"landlord\", \"field_name\": \"mobile\", \"db_model_manager\": \"UserProfileManager\"}, \"living_room_num\": {\"field_name\": \"living_room_num\", \"db_model_manager\": \"HouseInfoManager\"}, \"electricity_rent\": {\"field_name\": \"electricity_rent\", \"db_model_manager\": \"HouseInfoManager\"}, \"landlord_id_card\": {\"role\": \"landlord\", \"field_name\": \"id_card\", \"db_model_manager\": \"UserProfileManager\"}}','{\"order_id\": true, \"template_id\": false}','normal',NULL,'2022-04-30 12:15:54','2022-04-30 12:15:57','electronic_contract');
